import * as React from 'react';
import { StyleSheet } from 'react-native';
import { createMaterialBottomTabNavigator } from '@react-navigation/material-bottom-tabs';
import PainLogEntry from '../shared/PainLogEntry';
import Contacts from '../shared/Contacts';
import Agenda from '../shared/Agenda';
import CalendarEntry from '../shared/CalendarEntry';
import Icons from '@expo/vector-icons';

type MaterialBottomTabParams = {
  Agenda: undefined;
  CalendarEntry: undefined;
  PainLogEntry: undefined;
  Contacts: undefined;
};

const MaterialBottomTabs = createMaterialBottomTabNavigator<
  MaterialBottomTabParams
>();

export default function MaterialBottomTabsScreen() {
  return (
    <MaterialBottomTabs.Navigator barStyle={styles.tabBar}>
      <MaterialBottomTabs.Screen
        name="Agenda"
        component={Agenda}
        options={{
          tabBarLabel: 'Agenda',
          tabBarIcon: ({ color }) => (
            <Icons.MaterialIcons name="home" color={color} size={26} />
          ),
          tabBarColor: '#C9E7F8',
        }}
      />
      <MaterialBottomTabs.Screen
        name="CalendarEntry"
        component={CalendarEntry}
        options={{
          tabBarLabel: 'Calendar',
          tabBarIcon: ({ color }) => (
            <Icons.MaterialIcons name="calendar" color={color} size={26} />
          ),
          tabBarColor: '#C9E7F8',
        }}
      />
      <MaterialBottomTabs.Screen
        name="Contacts"
        component={Contacts}
        options={{
          tabBarLabel: 'Contacts',
          tabBarIcon: ({ color }) => (
            <Icons.MaterialIcons name="contacts" color={color} size={26} />
          ),
          tabBarColor: '#F7EAA2',
        }}
      />
      <MaterialBottomTabs.Screen
        name="PainLogEntry"
        component={PainLogEntry}
        options={{
          tabBarLabel: 'PainLog',
          tabBarIcon: ({ color }) => (
            <Icons.MaterialIcons name="human" color={color} size={26} />
          ),
          tabBarColor: '#FAD4D6',
        }}
      />
    </MaterialBottomTabs.Navigator>
  );
}

const styles = StyleSheet.create({
  tabBar: {
    backgroundColor: 'white',
  },
});
